%[text] ## 0.1 Intro
%[text] Willkommen zu deinem ersten Schritt in die Welt des Programmierens mit MATLAB! In diesem Tutorial lernst du die grundlegenden Funktionen und das Layout von MATLAB kennen, damit du dich mit der Programmier-Umgebung und den Werkzeuge von MATLAB vertraut machen kannst.
%[text] **MATLAB-Programmier-Umgebung**
%[text] Wenn du MATLAB öffnest, siehst du eine Arbeitsumgebung mit mehreren Fenstern. Jedes dieser Fenster hat eine spezifische Funktion, die wir hier kurz erklären:
%[text] Das Fenster, in welchem du gerade den Text liest, ist der (Live) **Editor** (siehe Titel oben im blauen Kästchen). Hier kann man Skripte schreiben und abspeichern. Bei unseren Tutorials handelt es sich um Live-Skripte. Diese bieten den Vorteil, dass Resultate von Berechnungen immer gleich rechts neben dem Code angezeigt werden – ideal, um Schritt für Schritt zu lernen und Ergebnisse anschaulich darzustellen. Damit das alles funktioniert, müsstest du jetzt kurz oben in der Auswahl auf den grünen Pfeil 'Run' (im Tab 'Live Editor') klicken. Falls alles geklappt hat, solltest du als Beispiel gleich hier rechts 'Hallo!' sehen. 
disp("Hallo!") %[output:72979db2]
%[text] Im Bild siehst du eine Anordnung der verschiedenen anderen Fenster der Arbeitsumgebung in MATLAB. Diese können aber beliebig herumgeschoben werden. Falls du einmal die Übersicht verlierst und die Standardeinstellungen wieder herstellen möchtest, kannst du im Tab 'Home' auf 'Layout' un dann auf 'Default' klicken.
%[text] ![](text:image:19f5)
%[text] Das **Command Window** (meistens unten) ist das zentrale Fenster, in dem du MATLAB-Befehle direkt ausführen kannst. Es funktioniert wie eine Konsole, in der du Befehle eintippen und die Ergebnisse sofort sehen kannst. Die Befehle werden aber nicht gespeichert, darum schreiben wir normalerweise unseren Code im Editor.
%[text] Im **Workspace**-Fenster siehst du alle aktuell in MATLAB gespeicherten Variablen (später mehr dazu). Dies ist wie ein Überblick über deinen Arbeitsplatz, der zeigt, welche Daten du gerade verwendest. Hier kannst du Variablen überprüfen, bearbeiten oder löschen. Momentan sollten darin alle geladenen Variablen angezeigt werden. Ansonsten müsstest du (nochmal) den grünen Pfeil 'Run' (im Tab 'Live Editor') klicken.
%[text] Das Fenster des **Current Folder** zeigt den Ordner, in dem deine Dateien gespeichert sind. Es hilft dir, schnell auf Skripte und Daten zuzugreifen.
%[text] Auf den ersten Blick kann das etwas überwältigend wirken. Aber keine Angst, momentan musst du nur hier im Live-Editor Schritte befolgen. Du musst folgend auch nichts eingeben, der ganze Code stimmt bereits. Konzentriere dich darauf, die Benutzeroberfläche kennenzulernen und die Inhalte der nachfolgenden Kapitel zu verstehen.
%[text] Dieses Tutorial ist so gestaltet, dass du nicht alles auswendig lernen musst. Vielmehr geht es darum, ein grundlegendes Verständnis dafür zu entwickeln, wie Programmieren mit MATLAB funktioniert. Du wirst später im Blockkurs viele Gelegenheiten haben, das Gelernte anzuwenden. Falls es am Ende eines Kapitels Exkurse gibt, sind diese für besonders Interessierte gedacht, jedoch werden viele der dort angesprochenen Inhalte in den Praxis-Teilen des Blockkurses relevant sein. Sie können vorerst übersprungen werden, wenn du dich auf die wesentlichen Inhalte konzentrieren möchtest.
%[text] Ein weiterer Tipp: Wenn manche Befehle unklar sind, bietet MATLAB immer eine 'Hilfe'-Funktion an. Dazu muss unten im command window "help Befehl" eingegeben werden, also beispielsweise: help disp
%[text] ## 0.2 Code und Text
%[text] Im Folgenden wirst du eine Mischung von MATLAB-Code und Text finden. Der Text ist jeweils ganz normal dargestellt, wie der Satz, den du gerade liest. Der Code ist abgegerenzt vom Text durch eine andere Schriftart und graue Boxen. Hier ein kleines Beispiel:
% Beispiel für Code-Box in MATLAB Live-Skript
beispielArray = [4, 5, 6, 7];
%[text] Dir wird weiter unten bestimmt auffallen, dass aller Text in den Code-Fenstern, der hinter einem '%'-Zeichen geschrieben wird, in grün erscheint. Das sind sogenannte Kommentare. Diese werden dazu verwendet, einzelnen Teilen grosser Skripte Titel zu geben und den darin enthaltenen Code zu erklären. Alles, was in den Kommentaren steht, wird von MATLAB ignoriert und nicht ausgeführt.
%[text] **EXKURS Schriftarten**: Die für das Programmieren verwendeten Schriftarten sind nicht zufällig gewählt! Vielleicht erinnert dich die Schriftart in den grauen Boxen an das Resultat der Arbeit an einer Schreibmaschine. Die Idee dahinter ist genau dieselbe: Bei der Schreibmaschine sollen alle Buchstaben genau gleich viel Platz beanspruchen, damit keine Überlappungen geschehen. Beim Programmieren sorgt das für eine saubere, übersichtliche Struktur. Solche Schriftarten nennt man monospaced, da alle Buchstaben genau die gleiche Fläche beanspruchen.
%[text] ## 1.1 Variablen
%[text] **Variablen** sind **Speicherorte**. Sie sind wichtig, da sie es uns ermöglichen, Werte zu speichern und diese später im Code wieder zu verwenden, ohne den Wert jedes Mal erneut eingeben zu müssen. 
%[text] In MATLAB können wir eine Variable erstellen, indem wir ihr einen Namen geben und ihr mit dem Zeichen '=' einen Wert zuweisen.
% Erstellen einer Variable 'a' für eine Zahl
a = 5 %[output:31ef9c6b]
%[text] Wir können also unserer Variable 'a' den Wert 5 zuordnen. Machen wir das nun mit einer zusätzlichen Variable:
% Erstellen einer zusätzlichen Variable 'b' für eine Zahl
b = 3 %[output:24ee487d]
%[text] Jetzt haben wir unserer zweiten Variable 'b' den Wert 3 zugeordnet.
%[text] Mit diesen Variablen können wir nun jegliche **mathematischen Operationen** ausführen.
% Mathematische Operationen mit Variablen
a + b    % Addition %[output:4a35387d]
a - b    % Subtraktion %[output:341a7ca7]
a * b    % Multiplikation %[output:42f4ef94]
a / b    % Division %[output:57e8a851]
sqrt(a)  % Wurzel %[output:749dff43]
a^b      % Exponent %[output:5e989d9e]
%[text] Auf der rechten Seite werden nun die Resultate der mathematischen Operationen angezeigt. Wie du vielleicht schon bemerkt hast, werden nicht mehr nur die blossen Zahlen ausgegeben, sondern jetzt steht vor jedem Resultat 'ans'. MATLAB gibt uns hier die Antwort (darum 'ans', von answer), jedoch wird diese so nicht gespeichert! Um Resultate zu speichern, weisen wir diese einer neuen Variable zu. 
% Mathematische Operationen mit Variablen, Resultate werden gespeichert
add  = a + b    % Addition %[output:572a994f]
sub  = a - b    % Subtraktion %[output:21bc0c43]
mult = a * b    % Multiplikation %[output:4203a725]
div  = a / b    % Division %[output:27805e98]
wurz = sqrt(a)  % Wurzel %[output:9b0d0b36]
exp  = a^b      % Exponent %[output:5374c4b5]
%[text] Jetzt haben wir alle Variablen gespeichert! Normalerweise möchten wir jedoch nicht, dass wir alle Resultate direkt ausgespuckt kriegen, das kann bei grösseren Skripten nämlich ziemlich unübersichtlich werden. Deshalb schreiben wir in MATLAB hinter jeder Zeile, deren Output wir nicht sehen möchten, das Zeichen ';'.
% Versteckter Ouput durch ';'
add  = a + b;    % Addition
%[text] Um uns anzeigen zu lassen, was sich in einer Variable befindet, können wir entweder deren Namen eingeben, oder die Funktion '**`disp`**' (display) verwenden.
% Ausgabe der Werte der Variablen
add %[output:49df5bc9]
disp(add) %[output:1105a197]
%[text] Auf der rechten Seite dieses Fensters sind die Werte nun ersichtlich, die in den Variablen 'a', 'b' und 'add' gespeichert wurden.
%[text] Variablen müssen aber nicht unbedingt Zahlen enthalten. Wir können auch **Buchstaben** in Variablen speichern.
% Erstellen einer Variable für Text
name = 'MATLAB';
alphabet = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
%[text] Um uns anzeigen zu lassen, was sich in einer Variable befindet, können wir wiederum die Funktion '**`disp`**' verwenden.
% Ausgabe der Werte der Variablen
disp(name); %[output:82a86b2d]
disp(alphabet); %[output:161bd1f1]
%[text] **EXKURS Benennung von Variablen**: Der Name der Variablen kann frei gewählt werden, sollte jedoch aussagekräftig und selbsterklärend sein, um die Lesbarkeit des Codes zu erhöhen. Die Konvention beim Programmieren ist dabei das sogenannte **camelCase**. Das camelCase beschreibt eine Art der Schreibweise von Variablennamen, bei der mehrere Wörter ohne Trennzeichen aneinandergereiht werden. Dabei werden die Anfangsbuchstaben ab dem zweiten Wort grossgeschrieben, um die Lesbarkeit zu verbessern. Der Name rührt daher, dass die grossen Anfangsbuchstaben wie die Höcker eines Kamels aussehen. Beispiele: variablenNamen, zeilenVektor, spaltenVektor. Darus sollte implizit schon verständlich sein, dass MATLAB fallunterscheidend ist, d.h., 'Variable' und 'variable' sind nicht das Gleiche.
%[text] ## 1.2 Arrays und Matrizen
%[text] Ein **Array** ist eine **Sammlung von Werten**, die in einer bestimmten Reihenfolge angeordnet sind. Ein Array wird mit eckigen Klammern `[]` erstellt, wobei die Werte mit Kommas, Strichpunkten oder Leerzeichen getrennt werden.
%[text] Ein eindimensionales Array (wie eine Liste) nennen wir in MATLAB **Vektor**. Dabei kann diese eine Dimension entweder eine Zeile sein, oder eine Spalte.
% Erstellen eines Zeilenvektors (Array mit einer Zeile)
zeilenVektor = [1, 2, 3, 4, 5] %[output:6378e9fa]
%[text] Wenn wir aufeinanderfolgende Zahlen in einer Variable abspeichern möchten, können wir auch einfach einen Doppelpunkt verwenden.
% Erstellen eines Zeilenvektors (Array mit einer Zeile)
zeilenVektor = 1:5 %[output:10edd6c9]
%[text] Ab und zu benötigen wir ein leeres Array, bspw. wenn wir bei einer Funktion (siehe unten) bestimmte Optionen per default lassen möchten.
% Erstellen eines leeren Arrays
leeresArray = [] %[output:48c79e32]
%[text] Wie du oben sehen kannst, werden Werte, die in derselben Zeile stehen sollen, mit einem Komma getrennt. Wenn wir die Werte in einer neuen Zeile haben möchten, trennen wir sie mit einem Strichpunkt (';').
% Erstellen eines Spaltenvektors (Array mit einer Spalte)
spaltenVektor = [6; 7; 8; 9; 10] %[output:0596c900]
%[text] Nun kann man Zeilen und Spalten beliebig verbinden. Ein daraus resultierendes zweidimensionales Array (ähnlich einer Tabelle) nennen wir in MATLAB **Matrix**.
% Erstellen einer Matrix (2x3 Matrix mit 2 Zeilen und 3 Spalten)
matrix = [1, 2, 3; 4, 5, 6] %[output:00b432c4]
%[text] Natürlich können Vektoren und Matrizen auch mit Buchstaben erstellt werden. Einen Buchstabenvektor haben wir bereits weiter oben gesehen, als wir uns das Alphabet haben ausgeben lassen.
% Erstellen eines Vektors mit Buchstaben
buchstabenVektor = ['A', 'B', 'C'] %[output:8c4cddf4]
alphabet %[output:242141d7]

% Erstellen einer Matrix mit Buchstaben
buchstabenMatrix = ['A', 'B', 'C'; 'D', 'E', 'F'] %[output:8eeb2c8d]
%[text] Auch bei aufeinanderfolgenden Buchstaben kann man wieder den Doppelpunkt verwenden.
% Erstellen eines Vektors mit Buchstaben
alphabet = 'A':'Z' %[output:88ce8ddd]
%[text] ## 1.2.1 Konkatenieren
%[text] Das Konkatenieren beschreibt das Verbinden von Arrays oder Matrizen. Dies ermöglicht es, grössere Arrays oder Matrizen aus mehreren Kleineren zu erstellen, indem sie aneinandergehängt werden. Dabei gibt es zwei grundlegende Arten des Konkatenierens: horizontal und vertikal.
%[text] **Horizontales Konkatenieren**
%[text] Beim horizontalen Konkatenieren werden Arrays oder Matrizen nebeneinander verbunden. Wir benutzen dabei ein Komma zwischen den Zahlen.
% Zeilenvektoren horizontal verbinden
vektor1 = [1, 2, 3] %[output:1ede309c]
vektor2 = [4, 5, 6] %[output:632a0c80]
verbundenerVektor = [vektor1, vektor2] %[output:165d2f4b]
%[text] **Vertikales Konkatenieren**
%[text] Beim vertikalen Konkatenieren werden Arrays oder Matrizen untereinander verbunden. Wir benutzen dabei einen Strichpunkt zwischen den Zahlen.
% Zeilenvektoren vertikal verbinden
verbundenerVektor = [vektor1; vektor2] %[output:3ea943dd]
%[text] **Wichtig:** Beim Konkatenieren müssen die Dimensionen der Arrays oder Matrizen zueinander passen. Zum Beispiel müssen bei horizontalem Konkatenieren die Anzahl der Zeilen gleich sein, und bei vertikalem Konkatenieren die Anzahl der Spalten.
%[text] **EXKURS Matrizen Konkatenieren:** Wir können auch ganze Matrizen konkatenieren. Das funktioniert genau gleich, wie oben beschrieben. Wir benutzen Kommas für horizontales Konkatenieren und Strichpunkte für vertikales Konkatenieren.
% Matrizen erstellen
matrix1 = [vektor1; vektor2] %[output:5d50d178]
matrix2 = [7, 8, 9; 10 11 12] %[output:2d5b90bf]

% Matrizen vertikal verbinden
verbundeneMatrix = [matrix1, matrix2] %[output:900c4bca]

% Matrizen horizontal verbinden
verbundeneMatrix = [matrix1; matrix2] %[output:70565457]
%[text] ## 1.3 Klammern 
%[text] **Klammern** haben in MATLAB unterschiedliche Bedeutungen. 
%[text] Runde Klammern **`( )`** werden für das Aufrufen von Funktionen und zur Indizierung (siehe 1.4 Indizierung) verwendet. 
% Rundklammern für die Funktionseingabe
wurzel25 = sqrt(25) %[output:44af3eea]
%[text] In diesem Beispiel verwenden wir runde Klammern, um der Funktion `sqrt` die Zahl `25` als Eingabe zu geben. Als Resultat erhalten wir `b = 5`.
%[text] Wie oben gelernt, werden eckige Klammern **`[ ]`** für das Konkatenieren verwendet. Somit kann man mit Hilfe der eckigen Klammern Arrays oder Matrizen erstellen.
% Eckige Klammern für das Erstellen eines Arrays
array = [1, 2, 3, 4] %[output:7c3f9f3e]
%[text] Eckige Klammern wurden in diesem Beispiel verwendet, um ein Array mit den Werten `1, 2, 3, und 4` zu erstellen.
%[text] **EXKURS Geschweifte Klammern**: Geschweifte Klammern **`{ }`** verwendet man für Zellen-Arrays. Diese spezielle Art von Arrays besitzt die Besonderheit, dass unterschiedliche Datentypen hinein gepackt werden können.
% Geschweifte Klammern für Arrays mit verschiedensten Daten
zellenArray = {buchstabenVektor, wurzel25, array} %[output:637ef757]
%[text] In unserem `zellenArray` haben wir jetzt verschiedenste Daten gesichert. In Zelle (1,1) befinden sich die Buchstaben 'ABC' aus unserem `buchstabenVektor`. In Zelle (1,2) befindet sich die Zahl 5 aus Variable `wurzel25`. In Zelle (1,3) befindet sich unser array mit den Zahlen 1, 2, 3, 4. Wir sehen also, dass die Verwendung von Zellen-Arrays uns dazu befähigt, unterschiedliche Datentypen in einer Variable abzulegen.
%[text] ## 1.4 Indizierung
%[text] **Indizierung** nennt man die Methode, mit der man auf bestimmte Elemente eines Arrays oder einer Matrix zugreift. In MATLAB beginnt die Indizierung bei `1`, das heisst, das erste Element eines Arrays hat den Index `1`. Man kann auf Elemente zugreifen, indem man die Position des Elements in runden Klammern angibt.
%[text] Bei einem Vektor ist das ganz einfach. Wir geben einfach genau die Position des Elements in der Liste an.
% Zugriff auf ein bestimmtes Element in einem Array
array = [10, 20, 30, 40];
zweitesElement = array(2) %[output:266085ca]
%[text] In einer (zweidimensionalen) Matrix funktioniert das genau gleich! Jedoch müssen wir hier angeben, in welcher Zeile und in welcher Spalte sich unser gewünschstes Element befindet. Dies können wir tun, indem wir zuerst den Wert für die Zeile angeben, und danach, mit einem Komma getrennt, den wert für die Spalte. Mit `matrix(2, 3)`  greifen wir also auf das Element in der zweiten Zeile und dritten Spalte zu, was hier `6` ist. 
% Zugriff auf ein Element in einer Matrix
matrix = [1, 2, 3; 4, 5, 6];
sechs = matrix(2, 3); % Zweite Zeile, dritte Spalte
%[text] **EXKURS Index finden mit Funktion**: Natürlich kann man hier auch wieder geschickt eine Funktion verwenden. Beispielweise kann man mit der Funktion `find` den Index eines bestimmten Wertes finden.
% Index finden im Array
vierzigArrayIndex = find(array == 40) %[output:7f315eaf]
array(vierzigArrayIndex) %[output:7a13c27e]

% Index finden in einer Matrix
[fuenfZeileMatrixIndex, fuenfSpalteMatrixIndex] = find(matrix == 5) %[output:3bb75a7c] %[output:8565da28]
matrix(fuenfZeileMatrixIndex, fuenfSpalteMatrixIndex) %[output:86f0858a]
%[text] Im Exkurs wird gezeigt, wie man mit der Funktion `find` die Position (Index) eines bestimmten Wertes in einem Array oder einer Matrix findet und dann auf dieses Element zugreift: Mit `find(array == 40)` wird der Index des Wertes `40` im Array gefunden. Dieser Index (hier: vierte Stelle im array) wird genutzt, um direkt auf das Element zuzugreifen: `array(vierzigArrayIndex)`. Mit `[fuenfZeileMatrixIndex, fuenfSpalteMatrixIndex] = find(matrix == 5)` werden die Zeilen- und Spaltenindizes des Wertes `5 (2, 2)` in der Matrix gefunden. Anschliessend kann direkt auf das Element zugegriffen werden: `matrix(fuenfZeileMatrixIndex, fuenfSpalteMatrixIndex)`. Die Funktion `find` gibt also die Position(en) zurück, an denen die Bedingung erfüllt ist. Diese können direkt für den Zugriff auf das Element verwendet werden.
%[text] ## 1.5 Funktionen
%[text] **Funktionen** sind spezielle Befehle aus vorprogrammiertem Code, die eine bestimmte Aufgabe ausführen.
%[text] Wir kennen bereits zwei Funktionen! Im Kapitel 1.1 Variablen haben wir 'disp' und 'sqrt' kennengelernt. Funktionen werden durch ihren Namen aufgerufen und nehmen Argumente (Eingaben) in runden Klammern `( )` entgegen. Sie geben ein Ergebnis zurück, das in einer Variable gespeichert werden kann.
% Berechnung der Quadratwurzel einer Zahl
wurzel = sqrt(16);

% Ausgabe des Ergebnisses
disp(wurzel) %[output:801b645a]
%[text] Hier wird die Funktion '`sqrt`' verwendet, um die Quadratwurzel der Zahl `16` zu berechnen. Das Ergebnis, `4`, wird in der Variable `wurzel` gespeichert. Dieses Ergebnis geben wir mit der Funktion '`disp`' aus.
%[text] In MATLAB gibt es viele eingebaute Funktionen, die häufige mathematische Berechnungen durchführen. Beispielsweise können wir uns den Mittelwert ausgeben lassen. Wir zeigen das nun direkt anhand unser gerade eben definierten Vektoren.
% Berechnung des Mittelwerts aus einem Vektor
mittelwertZeilenVektor = mean(zeilenVektor) %[output:4c61cda3]
%[text] Der Mittelwert aus unserer Variable `zeilenVektor` ist also 3. Das Ganze geht natürlich genau gleich mit der Variable `spaltenVektor`.
% Berechnung des Mittelwerts aus einem Vektor
mittelwertSpaltenVektor = mean(spaltenVektor) %[output:50679b49]
%[text] Bei `spaltenVektor` ist der Mittelwert also 8. Funktionen erleichtern uns komplexe Berechnungen, da wir nur den Namen der Funktion und die Eingabewerte angeben müssen. 
%[text] Es gibt zahlreiche andere Funktionen, die in MATLAB verwendet werden können. Wir werden noch viele andere Funktionen im Kurs kennenlernen.
%[text] ## **1.6 Kontrollstrukturen**
%[text] Mit Kontrollsturlkturen kann man den Ablauf von Programmcode steuern. Wir werden uns hier lediglich die beiden essenziellen Strukturen if-else und for-loops anschauen.
%[text] ##  **1.6.1 if-else**
%[text] In MATLAB können wir nur bestimmte Teile des Codes ausführen, indem wir **Bedingungen** verwenden. Eine Bedingung ist wie eine Frage, die entweder mit *wahr* (true) oder *falsch* (false) beantwortet wird. Je nachdem, ob die Bedingung wahr oder falsch ist, wird ein bestimmter Teil des Codes ausgeführt. Dafür verwenden wir die **if-else-Struktur**.
% Beispiel if-else: Überprüfung, ob eine Zahl positiv ist
zahl = -5;
if zahl > 0 %[output:group:002b45e4]
    disp('Die Zahl ist positiv.');
else
    disp('Die Zahl ist negativ.'); %[output:38b04ad3]
end %[output:group:002b45e4]
%[text] Hier überprüfen wir, ob die Variable `zahl` grösser als 0 ist. Wenn ja, wird `'Die Zahl ist positiv.'` ausgegeben. Wenn die Variable `zahl` kleiner als 0 ist, wird `'Die Zahl ist negativ.'` ausgegeben. Anstatt \> und \< kann man auch == (gleich) und ~= (ungleich) verwenden. Die if-else-Struktur muss immer mit einem abschliessenden `end` geschlossen werden. Probiere mal aus, was passiert, wenn du eine positive Zahl definierst (e.g. 5).
%[text] Nun kann man noch eine weitere Bedingung hinzufügen. Was soll denn ausgegeben werden, wenn die Zahl genau 0 ist?
% Beispiel if-else: Überprüfung, ob eine Zahl positiv ist
zahl = 0;
if zahl > 0 %[output:group:4c14cd06]
    disp('Die Zahl ist positiv.');
elseif zahl == 0
    disp('Die Zahl ist 0.'); %[output:9c1be338]
else
    disp('Die Zahl ist negativ.');
end %[output:group:4c14cd06]
%[text] Die zusätzliche Linie Code `elseif` ermöglicht es uns, eine andere Bedingung mit einem anderen Outcome hinzuzufügen. Dies können wir beliebig oft tun. Für alle Fälle, in denen die `if` und `elseif` Konditionen nicht greifen, wird `else` angewendet.
%[text] ## 1.6.2 for-loops
%[text] Die zweite essenzielle Kontrollstruktur sind sogenannte **for-Schleifen** (oder eng. for-loops). Diese werden verwendet, um eine bestimmte Aktion wiederholt auszuführen. Die Anzahl der Wiederholungen wird durch die Schleifenvariable definiert.
% Beispiel for-loop: Zahlen von 1 bis 5 ausgeben
for i = 1:5 %[output:group:0270ac90]
    disp(['Die aktuelle Zahl ist: ', num2str(i)]) %[output:4f083efa]
end %[output:group:0270ac90]
%[text] In diesem Beispiel definieren wir `i` als Schleifenvariable, die von 1 bis 5 läuft. Das Ganze liest sich dann also so: Starte bei i = 1, erhöhe den Wert bei jedem Durchgang um 1, und gehe bis i = 5. Auch im inneren der Schleife kann i verwendet werden um damit weitere Berechnungen zu machen. In diesem Beispiel wird die aktuelle Zahl (der Variable i) bei jedem Durchgang mit '`disp`' ausgegeben.
%[text] Hinweis: Bei dieser Textausgabe (disp) wollen wir die eckigen Klammern nutzen um zwei Textelemente miteinander zu verbinden. Dazu muss der Wert in i (z.B. die Zahl 1) jedoch zu dem Zeichen "1" umgewandelt werden. dies geschieht mit der Funktion num2str (steht kurz für "Nummer - zu - Zeichen ( eng. "number-to-string")). Für programmiersprachen sind Zahlen und Zeichen verschiedene Dinge (sogenannte "Datentypen").
%[text] Anstatt die Resultate direkt ausgeben zu lassen, können wir sie auch speichern und mit '`disp`' nach Beendigung der for-Schleife ausgeben.
% Beispiel: Quadrate der Zahlen von 1 bis 5 berechnen und speichern
for i = 1:5
    quadrate(i) = i^2;
end
disp('Die Quadrate der Zahlen von 1 bis 5:'); %[output:936f4465]
disp(quadrate) %[output:83b2a623]
%[text] Hier geschieht Folgendes:
%[text] In jedem Durchgang wird der aktuelle Wert von `i` quadriert (i^2). Wir verwenden ausserdem den aktuellen Wert `i` (bspw. 1 im ersten Schleifendurchgang) um das Resultat der quadrierung in einem Array '`quadrate`' abzuspeichern (`quadrate(i)`, siehe Indexierungs-Kapitel oben)
%[text] Konkret bedeuted das beispielhaft für Schleifendurchgang 2 und Schleifendurchgang 3: 
%[text] Schleifendurchgang 2: i hat aktuell den Wert 2. Somit wird 2 quadriert (=4) und das Ergebnis an die zweite Stelle im Array quadrate(2) abgespeichert.
%[text] Schleifendurchgang 3: i hat aktuell den Wert 3. Somit wird 3 quadriert (=9) und das Ergebnis an die dritte Stelle im Array quadrate(3) abgespeichert.
%[text] ## 1.7 Plotten
%[text] Plotten bedeutet, Daten grafisch darzustellen. MATLAB bietet dafür viele Funktionen, wobei **`plot`** am gebräuchlichsten ist. Mit **`plot`** kann man Werte als verbundene Datenpunkte in einem Diagramm darstellen, wobei die x-Werte (horizontale Achse) und die y-Werte (vertikale Achse) angegeben werden.
% Erstellen von x- und y-Werten
x = [0, 1, 2, 3, 4];
y = [0, 1, 4, 9, 16];

% Zeichnen des Plots
plot(x, y) %[output:8b7179f5]

% Hinzufügen von Titeln und Achsenbeschriftungen
title('Einfacher Plot von x und y'); %[output:8b7179f5]
xlabel('x-Werte'); %[output:8b7179f5]
ylabel('y-Werte'); %[output:8b7179f5]
%[text] Hier erstellen wir einen Plot, indem wir die Werte von `x` und `y` grafisch darstellen. Jeder Wert in `x` wird mit dem entsprechenden Wert in `y` kombiniert und auf der Karte gezeichnet. Die Achsen können beschriftet werden, um die Daten verständlicher zu machen.
%[text] **Gut gemacht! Du bist nun fertig mit Tutorial 1: Programmieren in MATLAB!** 
%[text] Folgend kommen noch einige Beispiele, wie man Plots weiter bearbeiten kann. Du darfst dir dies gerne anschauen, es ist aber komplett freiwillig. Auf jeden Fall geht es weiter mit **Tutorial 2: Digitale Signalverarbeitung**.
%[text] \----------------------------------------------------------------
%[text] **EXKURS Bearbeitung eines Plots**:
%[text] **Beispiel 1: Plot mit Linienfarbe und Linienstil**
%[text] Wir können die Linienfarbe und den Linienstil ändern, um den Plot ansprechender zu gestalten. MATLAB bietet viele Optionen, wie zum Beispiel `'r'` für rot, `'b'` für blau.
% Erstellen von x- und y-Werten
x = [0, 1, 2, 3, 4];
y = [0, 1, 4, 9, 16];

% Zeichnen des Plots mit roter Linie und gestricheltem Stil
plot(x, y, 'r--'); % 'r' für rot und '--' für gestrichelte Linie %[output:5793cdda]

% Hinzufügen von Titeln und Achsenbeschriftungen
title('Einfacher Plot mit benutzerdefiniertem Stil'); %[output:5793cdda]
xlabel('x-Werte'); %[output:5793cdda]
ylabel('y-Werte'); %[output:5793cdda]
%[text] In diesem Beispiel wird die Linie rot (`'r'`) und gestrichelt (`'--'`) dargestellt. MATLAB unterstützt auch viele andere Linienstile wie `'-.'` (Punkt-Strich) oder `':'` (punktierte Linie).
%[text] **Beispiel 2: Hinzufügen von Markern**
%[text] Wir können Markierungen (z.B. Punkte) an den Datenpunkten hinzufügen, um sie hervorzuheben. Diese Markierungen können durch spezielle Symbole dargestellt werden, wie z.B. Kreise, Quadrate oder Pluszeichen.
% Erstellen von x- und y-Werten
x = [0, 1, 2, 3, 4];
y = [0, 1, 4, 9, 16];

% Zeichnen des Plots mit Markern (Kreise) an den Datenpunkten
plot(x, y, 'r-o'); % 'o' fügt Kreismarker hinzu %[output:46b9e185]

% Hinzufügen von Titeln und Achsenbeschriftungen
title('Plot mit Markern'); %[output:46b9e185]
xlabel('x-Werte'); %[output:46b9e185]
ylabel('y-Werte'); %[output:46b9e185]
%[text] In diesem Fall wird jeder Punkt im Plot durch einen roten Kreis (`'o'`) angezeigt. Sie können auch andere Marker verwenden, wie z.B. `'*'` für Sterne oder `'+'` für Pluszeichen.
%[text] **Beispiel 3: Ändern der Achsenlimits**
%[text] Manchmal möchten wir die Achsen so anpassen, dass sie einen bestimmten Bereich abdecken oder die Darstellung der Daten verbessern. Dies lässt sich leicht mit der Funktion `axis` tun.
% Erstellen von x- und y-Werten
x = [0, 1, 2, 3, 4];
y = [0, 1, 4, 9, 16];

% Zeichnen des Plots
plot(x, y, 'b-'); % 'b' für blaue Linie %[output:7412f99b]

% Anpassen der Achsenlimits
axis([0 5 0 20]); % x-Achse von 0 bis 5, y-Achse von 0 bis 20 %[output:7412f99b]

% Hinzufügen von Titeln und Achsenbeschriftungen
title('Plot mit benutzerdefinierten Achsenlimits'); %[output:7412f99b]
xlabel('x-Werte'); %[output:7412f99b]
ylabel('y-Werte'); %[output:7412f99b]
%[text] In diesem Beispiel wird das Plot-Bereich durch `axis([0 5 0 20])` festgelegt, wobei der Bereich der x-Achse von 0 bis 5 und der Bereich der y-Achse von 0 bis 20 geht. Natürlich hört hier die Linie im Plot bei (4, 16) auf, da oberhalb davon keine Datenpunkte mehr definiert waren.
%[text] **Beispiel 4: Hinzufügen eines Gitters**
%[text] Das Hinzufügen eines Gitters kann dabei helfen, die Werte auf dem Plot besser zu visualisieren.
% Erstellen von x- und y-Werten
x = [0, 1, 2, 3, 4];
y = [0, 1, 4, 9, 16];

% Zeichnen des Plots
plot(x, y, 'g-o'); % 'g' für grün und 'o' für Marker %[output:7660a5b6]

% Hinzufügen eines Gitters
grid on; %[output:7660a5b6]

% Hinzufügen von Titeln und Achsenbeschriftungen
title('Plot mit Gitter'); %[output:7660a5b6]
xlabel('x-Werte'); %[output:7660a5b6]
ylabel('y-Werte'); %[output:7660a5b6]
%[text] Durch `grid on` wird das Gitter aktiviert, was dabei hilft, die Positionen der Datenpunkte besser zu erkennen.
%[text] **Beispiel 5: Ändern der Schriftart und Schriftgrösse**
%[text] Eine häufige Anpassung betrifft die Schriftarten und -grössen von Titeln und Achsenbeschriftungen. MATLAB erlaubt es, diese Eigenschaften mit den Funktionen `title`, `xlabel` und `ylabel` anzupassen.
% Erstellen von x- und y-Werten
x = [0, 1, 2, 3, 4];
y = [0, 1, 4, 9, 16];

% Zeichnen des Plots
plot(x, y, 'm-o'); % 'm' für magenta und 'o' für Marker %[output:3c489afd]

% Hinzufügen von Titeln und Achsenbeschriftungen mit angepasster Schriftgrösse und -art
title('Plot mit angepasster Schriftart', 'FontSize', 14, 'FontName', 'Arial'); %[output:3c489afd]
xlabel('x-Werte', 'FontSize', 12, 'FontName', 'Arial'); %[output:3c489afd]
ylabel('y-Werte', 'FontSize', 12, 'FontName', 'Arial'); %[output:3c489afd]
%[text] In diesem Beispiel ändern wir die Schriftgrösse und Schriftart für den Titel und die Achsenbeschriftungen. `FontSize` legt die Schriftgrösse fest, und `FontName` ändert die Schriftart.
%[text] **Beispiel 6: Plotten mehrerer Datensätze in einem Diagramm**
%[text] Oft möchten wir mehrere Datensätze in einem Diagramm darstellen. Das geht ganz einfach, indem wir mehrere `plot`-Befehle nacheinander verwenden. MATLAB fügt dann jede Serie in denselben Plot ein.
% Erstellen von x-Werten
x = [0, 1, 2, 3, 4];

% Erstellen von zwei verschiedenen Datensätzen
y1 = [0, 1, 4, 9, 16];
y2 = [0, 1, 2, 3, 4];

% Zeichnen des ersten Plots (blaue Linie)
plot(x, y1, 'b-o', 'DisplayName', 'y = x^2'); % 'DisplayName' gibt der Legende einen Namen %[output:20b8cd10]

hold on; % Hält den aktuellen Plot fest, damit weitere Daten darauf geplottet werden können %[output:20b8cd10]

% Zeichnen des zweiten Plots (rote Linie)
plot(x, y2, 'r-s', 'DisplayName', 'y = x'); % 's' für quadratische Marker %[output:20b8cd10]

% Hinzufügen einer Legende
legend show; %[output:20b8cd10]

% Hinzufügen von Titeln und Achsenbeschriftungen
title('Plot mit mehreren Datensätzen', 'FontSize', 14, 'FontName', 'Arial'); %[output:20b8cd10]
xlabel('x-Werte', 'FontSize', 12, 'FontName', 'Arial'); %[output:20b8cd10]
ylabel('y-Werte', 'FontSize', 12, 'FontName', 'Arial'); %[output:20b8cd10]

hold off; % Beendet das Festhalten des Plots %[output:20b8cd10]
%[text] In diesem Beispiel plotten wir zwei Datensätze (`y1` und `y2`) im selben Diagramm, wobei der erste Datensatz mit einer blauen Linie und Markern dargestellt wird und der zweite Datensatz mit einer roten Linie und quadratischen Markern. Für das überlagern der beiden Datensätze in einem Plot verwenden wir die Funktion '`hold on`'. Die Funktion '`legend show'` zeigt die Legende, die den jeweiligen Datensatz erklärt.

